	public static List<Integer> findSubstring(String s, String[] words) {
		List<Integer> list = new ArrayList<>();

		if (words.length == 0)
			return list;
		if (s.length() < words.length * words[0].length())
			return list;

		Map<String, Integer> map = new HashMap<>();

		for (String str : words) {
			map.put(str, map.getOrDefault(str, 0) + 1);
		}

		int wl = words[0].length();
		int tl = words.length * wl;
		Map<String, Integer> findmap = new HashMap<String, Integer>();
		for (int i = 0; i < s.length() - tl + 1; i++) {
			String temp = s.substring(i, i + tl);
			boolean found = true;
			for (int j = 0; j < temp.length(); j += wl) {
				String sb = temp.substring(j, j + wl);
				if (map.containsKey(sb) == false) {
					found = false;
					break;
				} else {
					findmap.put(sb, findmap.getOrDefault(sb, 0) + 1);
				}

			}
			if (found)
				for (Map.Entry<String, Integer> m : map.entrySet()) {
					if (m.getValue().equals(findmap.get(m.getKey()))) { //check this == won't work

					} else {
						found = false;
						break;
					}
				}

			if (found) {
				list.add(i);
			}

			findmap.clear();
		}

		return list;

	}

	private static int GCD(int maxg, int ming) {
		if (maxg % ming == 0)
			return ming;

		return GCD(ming, maxg % ming);
	}

	static class pair {
		int x;
		int y;

		private int hashCode;

		public pair(int x, int y) {
			this.x = x;
			this.y = y;

			this.hashCode = Objects.hash(x, y);
		}

		@Override
		public boolean equals(Object o) {
			if (this == o)
				return true;
			if (o == null || getClass() != o.getClass())
				return false;
			pair that = (pair) o;
			return x == that.x && y == that.y;

		}

		@Override
		public int hashCode() {
			return this.hashCode;
		}

		@Override
		public String toString() {
			return " (" + x + "," + y + ") ";

		}
	}

	static class FastScanner {
		BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
		StringTokenizer st = new StringTokenizer("");

		String next() {
			while (!st.hasMoreTokens())
				try {
					st = new StringTokenizer(br.readLine());
				} catch (IOException e) {
					e.printStackTrace();
				}
			return st.nextToken();
		}

		int nextInt() {
			return Integer.parseInt(next());
		}

		int[] readArray(int n) {
			int[] a = new int[n];
			for (int i = 0; i < n; i++)
				a[i] = nextInt();
			return a;
		}

		long nextLong() {
			return Long.parseLong(next());
		}
	}

